import './Secondsection.css'
import img from '../../../Data/images/second section/Upto.caf2216c1f60997aa8df.jpg'


const Secsec = () => {
    return (
        <div className='white-bcc'>
            <div className='imgsection'>
                <img src={img} alt='img' width={'20%'} />
                <div>
                    <p>Up To 70% Of - All T-Shirts & Accessories</p>
                </div>
            </div>
        </div>
    )
}

export default Secsec;
